from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    sentence = ""
    if not triples:
        return sentence

    subject = triples[0].subject
    parts = []
    for triple in triples:
        if triple.predicate == "category":
            parts.append(f"{subject} is a {triple.object}")
        elif triple.predicate == "country":
            parts.append(f"{subject} is in {triple.object}")
        elif triple.predicate == "capital":
            parts.append(f"{subject} has a capital city of {triple.object}")
        elif triple.predicate == "location":
            parts.append(f"{subject} is located in {triple.object}")
        elif triple.predicate == "dedicatedTo":
            parts.append(f"{subject} is dedicated to {triple.object}")
        elif triple.predicate == "designer":
            parts.append(f"{subject} was designed by {triple.object}")
        elif triple.predicate == "material":
            parts.append(f"{subject} is made of {triple.object}")
        elif triple.predicate == "inaugurationDate":
            parts.append(f"{subject} was inaugurated on {triple.object}")
        elif triple.predicate == "largestCity":
            parts.append(f"{triple.object} is the largest city in {subject}")
        elif triple.predicate == "leader":
            parts.append(f"{triple.object} is the leader of {subject}")
        elif triple.predicate == "currency":
            parts.append(f"The currency of {subject} is {triple.object}")
        else:
            parts.append(f"{subject} {triple.predicate} {triple.object}")

    sentence = ""
    for i, part in enumerate(parts):
        sentence += part
        if i < len(parts) - 1:
            sentence += ", and "  # Use ", and" instead of just ","
    return sentence.strip()

